import React from 'react';

function AboutPage() {
  return (
    <div className='AboutPage-main'>
        <img className='animate__animated animate__bounce' src={require('../images/running.png')} alt="alex running" />
        <h1>About Page</h1>
    </div>
  );
}

export default AboutPage;
